      SELECT * FROM tab0 (FORMAT parquet) WHERE NOT + col0 NOT IN ( + + col2 * + ( + col2 ), col1, + - col2 + + 57 + - - col2 * 4 * + ( + - col2 ), + col2 );
  - name: tab0

outputs:
  - name: q5256.out
    data: |
